import React from "react";

const Quote = props => (
    <figure>
    <img src={props.image} alt={props.character}/>
    <figcaption>
      <blockquote>
        Shoplifting is a victimless crime, like punching someone in the dark.
      </blockquote>
      <cite>Nelson Muntz</cite>
    </figcaption>
  </figure>
);

export default Quote;

